macro_rules! handle_pin_error {
    ($name:expr, $pin_driver:expr) => {
        match $pin_driver {
            Ok(pd) => pd,
            Err(err) => {
                println!("pin {} operation fails: {}", $name, err);
                panic!();
            }
        }
    };
}

